import React, { useState } from 'react';
import axios from "axios";

axios.defaults.withCredentials = true; // Pastikan cookie dikirim

const Dashboard = () => {
  const [userLogin, setUserLogin] = useState(null); // State untuk menyimpan data pengguna

  axios.get("http://localhost:5000/dashboard")
  .then((response) => {
    console.log("Data session:", response.data);
    setUserLogin(response.data);
  })
  .catch((error) => {
    console.error("Gagal mendapatkan session:", error.response.data);
  });

  return (
    <>
    <div>
    <h1>Selamat Datang {userLogin.role}</h1>
    <p>Anda login sebagai <span>{userLogin.role}</span></p>
    </div>
    </>
  );
};

export default Dashboard;
